import axios, { AxiosResponse } from "axios";

const getOneNews = (id)=> {
  const requestUrl = `https://api.tvmaze.com/lookup/shows?thetvdb=${id}`;
  const response = axios.get(requestUrl);
  console.log(response)
  return response;

};
export default getOneNews;
